      {
        "name": "month",
        "byte_offset": 14,
        "data_type": "U1",
        "description": "Month, range 1..12 (UTC)",
        "unit": "month"
      },
      {
        "name": "day",
        "byte_offset": 15,
        "data_type": "U1",
        "description": "Day of month, range 1..31 (UTC)",
        "unit": "d"
      },
      {
        "name": "hour",
        "byte_offset": 16,
        "data_type": "U1",
        "description": "Hour of day, range 0..23 (UTC)",
        "unit": "h"
